import React from 'react'
import styles from './UserCard.module.css'

const UserCard = (props) => {
    return (
        <div ref={props.ref} style={{height: `${props.height}px`,transition:'all 1s'}}>
            {props.username}
        </div>
    )
}

export default UserCard
